import React, { Component } from 'react';
import {
    Collapse,
    Navbar,
    input,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    Container,
    Row,
    Col,
    Jumbotron,
    Button
} from 'reactstrap';
// import './components/Input';

class App extends Component {
    constructor(props) {
        super(props);

        this.toggle = this.toggle.bind(this);
        this.state = {
            isOpen: false
        };
    }
    toggle() {
        this.setState({
            isOpen: !this.state.isOpen
        });
    }
    render() {
        return (
            <div>
                <Navbar color="dark" dark expand="lg">
                    <NavbarBrand href="/">Grid Order Tool</NavbarBrand>
                    <NavbarToggler onClick={this.toggle} />
                    <Collapse isOpen={this.state.isOpen} navbar>
                        <Nav className="ml-auto" navbar>
                            <NavItem>
                                <NavLink href="/components/">Hello Colleen!</NavLink>
                            </NavItem>
                            <NavItem>
                                <NavLink href="https://github.com/dylannirvana/gridorder">Github</NavLink>
                            </NavItem>
                        </Nav>
                    </Collapse>
                </Navbar>
                <Jumbotron>
                    <Container>
                        <Row>
                            <Col>
                                <h1>Welcome to GO App</h1>

                                // TODO: refer to parse component here
                                // TODO: build grid component to populate
                                // TODO: packery draggabilly and isotope functions
                                // TODO: export neworder
                                <p>
                                  <Button
                                      tag="a"
                                      color="danger"
                                      size="large"
                                      href="http://reactstrap.github.io"
                                      target="_blank"
                                  >
                                      Import the feed
                                  </Button>

                                </p>
                            </Col>
                        </Row>
                    </Container>
                </Jumbotron>
                <Jumbotron></Jumbotron>
            </div>
        );
    }
}

export default App;
